import '../estilos/ProjectBanner.css';
import ProjectSingle from './ProjectSingle';

export default function ProjectBanner(){
    return(
        <div className="projectsBanner">
            <div className="centerProject">
                <div className="w50">
                    <ProjectSingle 
                        imagemProjeto="../resources/projeto1portifolio.png" 
                        nomeProjeto="Teste"
                        descricaoProjeto="another test"
                        tecnologiasProjeto="testando"
                    />
                </div>
            </div>
        </div>
    );
}
